import Button from "react-bootstrap/Button";
import Dropdown from "react-bootstrap/Dropdown";
const About = () => {
  return (
    <div>
      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          Selecciona tu cuenta
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <Dropdown.Item href="#/Ervin">Action</Dropdown.Item>
          <Dropdown.Item href="#/Silvestre">Another action</Dropdown.Item>
          <Dropdown.Item href="#/Cardona">Something else</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
      <h1>View about</h1>
      <Button variant="primary" size="lg">
        Registrar
      </Button>
      <Button variant="secondary" size="lg">
        Iniciar
      </Button>
    </div>
  );
};
export default About;
